        function setColors() {
			    var myArrayData = ["101", "102", "103", "104", "105", "201", "202", "203", "204", "205", "206", "301", "302", "303", "304", "401", "402", "403", "404", "405", "406", "407", "408", "501", "502", "503", "504", "505"];
			var myArrayColors = ["#FFEBEB", "#FFD3D3", "#FFB8B8", "#FF9999", "#FF7474", "#FFD3D3", "#FF9999", "#FFB8B8", "#FFEBEB", "#FF9999", "#FFD3D3", "#FFD3D3", "#FFEBEB", "#FFB8B8", "#FFD3D3", "#FF9999", "#FFEBEB", "#FFEBEB", "#FFB8B8", "#FFEBEB", "#FFD3D3", "#FFD3D3", "#FF9999", "#FFB8B8", "#FFD3D3", "#FFEBEB", "#FF9999", "#FFB8B8", "#FFEBEB", "#FFEBEB", "#FFD3D3", "#FFB8B8", "#FFEBEB", "#FFD3D3", "#FF9999", "#FFB8B8"];
 for (i=0; i<myArrayData.length; i++) {
    myElem = document.getElementById(myArrayData[i]);
    myElem.setAttributeNS(null, "fill", myArrayColors[i]);
 }
}

function showData(evt) {
   myElem = document.getElementById("info");
   adat = findDataById(evt.target.id);
   myElem.firstChild.nodeValue = adat[1];
}

function findDataById(id) {
        for (i=0; i < arrData.length; i++) {
                if (arrData[i][0] == id) {
                   return arrData[i];
                }
        }
}
